script: |
  super -f text -I q9354.spq | sort > q9354.out

inputs:
  - name: q9354.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 65 NOT BETWEEN - 12 + - col2 * + col2 AND ( col2 - + 2 + - + col0 * 2 );
  - name: tab1

outputs:
  - name: q9354.out
    data: |
      51	14	96
